import React, { useState } from "react"
import { useConfig } from "../../../context/AdminContext"
import { Link } from "react-router-dom";
import EditModal from "../Buttons/EditModal";
import DeleteModal from "../Buttons/DeleteModal";
import { transform } from "typescript";

let data = [
    { name: 'Nico Amico', date: '10/01', time: '13:00', action: 'Editar' },
    { name: 'Lio Messi', date: '18/12', time: '15:00', action: 'Editar' },
    { name: 'Kun Agüero', date: '18/12', time: '15:00', action: 'Editar' },
    { name: 'Diego Maradona', date: '10/10', time: '15:00', action: 'Editar' }
];

data = data.concat(data).concat(data).concat(data).slice(0, 9)

const MainEditor = () => {
    const { config } = useConfig()
    const pageStep = 4
    const [visibleItems, setVisibleItems] = useState(pageStep);
    const totalItems = data.length;

    const handleSeeMore = () => {
        setVisibleItems(prevVisibleItems => prevVisibleItems + pageStep);
    };

    const arrowIco = (inverted = false) => {
        return (
            <svg style={{ transform: inverted ? "rotate(180deg)" : "none" }} width="30" height="17" viewBox="0 0 30 17" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M16.4142 16.4142C15.6332 17.1953 14.3668 17.1953 13.5858 16.4142L0.857865 3.68629C0.076816 2.90524 0.0768161 1.63891 0.857865 0.857864C1.63891 0.076815 2.90524 0.0768151 3.68629 0.857864L15 12.1716L26.3137 0.857865C27.0948 0.0768161 28.3611 0.0768162 29.1421 0.857865C29.9232 1.63891 29.9232 2.90524 29.1421 3.68629L16.4142 16.4142ZM17 13L17 15L13 15L13 13L17 13Z" fill="white" fillOpacity="0.8" />
            </svg>
        )
    }

    if (!config) return (<></>)

    return (
        <div className="mainContainer">
            <span className="initialTitle">¡Hola, <strong>{config.customization.shopName}!</strong></span>
            <span className="proxApo">
                Próximos turnos
            </span>
            <div className="blackLayout">
                <div className="proxApoHeader rowContainer">
                    <div className="rowItem" style={{ width: "50%" }}><span>Cliente</span></div>
                    <div className="rowItem" style={{ width: "calc(50% / 3)" }}><span>Día</span></div>
                    <div className="rowItem" style={{ width: "calc(50% / 3)" }}><span>Hora</span></div>
                    <div className="rowItem" style={{ width: "calc(50% / 3)" }}><span>Editar</span></div>
                </div>
                {data.slice(0, visibleItems).map((item, index) => (
                    <div className="rowContainer" key={index}>
                        {Object.values(item).map((value, index) => (
                            <div className="rowItem" key={index} style={{ width: index === 0 ? '50%' : `calc(50% / 3)` }}>
                                {value !== "Editar" ? (
                                    <span>{value}</span>
                                ) : (
                                    <div className="actionsContainer">
                                        <DeleteModal />
                                        <EditModal />
                                    </div>
                                )}
                            </div>
                        ))}
                    </div>
                ))}
            </div>

            <div className="seeAllApo">
                {totalItems > visibleItems && (
                    <button className="seeAllButton" onClick={handleSeeMore}>
                        Ver más
                        {arrowIco(false)}
                    </button>
                )}
            </div>

            <div className="actionButtonsCont">
                <div className="buttonCont">
                    <Link to={"/admin/personalizacion"}>
                        <div className="circularButton">
                            <svg width="66" height="68" viewBox="0 0 66 68" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                                <rect opacity="0.9" width="66" height="68" fill="url(#pattern0_192_1480)" />
                                <defs>
                                    <pattern id="pattern0_192_1480" patternContentUnits="objectBoundingBox" width="1" height="1">
                                        <use xlinkHref="#image0_192_1480" transform="matrix(0.00201231 0 0 0.00195312 -0.0151515 0)" />
                                    </pattern>
                                    <image id="image0_192_1480" width="512" height="512" xlinkHref="data:image/png;base64," />
                                </defs>
                            </svg>
                        </div>
                    </Link>
                    <span className="circButtonTitle">Personalizar</span>
                </div>
                <div className="buttonCont">
                    <div className="circularButton">
                        <svg width="67" height="68" viewBox="0 0 67 68" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                            <rect opacity="0.9" width="67" height="68" fill="url(#pattern0_192_1481)" />
                            <defs>
                                <pattern id="pattern0_192_1481" patternContentUnits="objectBoundingBox" width="1" height="1">
                                    <use xlinkHref="#image0_192_1481" transform="matrix(0.00198228 0 0 0.00195312 -0.00746269 0)" />
                                </pattern>
                                <image id="image0_192_1481" width="512" height="512" xlinkHref="data:image/png;base64," />
                            </defs>
                        </svg>
                    </div>
                    <span className="circButtonTitle">Calendario</span>
                </div>
            </div>
        </div>
    )
}

export default MainEditor